import classes from "./MaterialItem.module.css";

const MaterialItem = (props) => {
  return (
    <Card>
      <li classes={classes.material}>
        <div>
          <h3>{props.name}</h3>
        </div>
      </li>
    </Card>
  );
};

export default MaterialItem;
